private static IntsRef toIntsRef(BytesRef br, IntsRef ir) {
  if (br.length > ir.ints.length) {
    ir.grow(br.length);
  }
  for(int i=0;i<br.length;i++) {
    ir.ints[i] = br.bytes[br.offset+i]&0xFF;
  }
  ir.length = br.length;
  return ir;
}

